    true,nt"url": null,nt"notes": "The Oceanic Flight Data Processing System
    (OFDPS) is the flight data processing system located at the Honolulu Control Center
    (HCF) Combined Center and Radar Approach Control (CERAP) site.  It provides full
    flight data processing and all external communications for both Hawaii and the Guam
    CERAP.   OFDPS provides the FDP support and interfaces with the Micro-EARTS systems,
    which provide the surveillance data processing support, at both the Hawaii and Guam
    facilities.OFDPS was rehosted onto new hardware using the existing OFDPS application
    software as part of the En Route Host/Oceanic Computer System Replacement (HOCSR)
    program.",nt"license_title": "Other License Specified",nt"extras": [{ntt"key":
